import React from 'react'
import {
    AboutMeContainer,
    AboutMeTop,
    AboutMeImgContainer,
    AboutMeImage,
} from './AboutMeElements'

const AboutMe = ({ img, intro, occupation }) => {
    return (
        <AboutMeContainer>
            <AboutMeTop>
                <AboutMeImgContainer>
                    <AboutMeImage alt="AboutMeImage" src={img} />
                </AboutMeImgContainer>
                <AboutMeIntroContainer>{intro}</AboutMeIntroContainer>
            </AboutMeTop>
        </AboutMeContainer>
    )
}

export default AboutMe
